import ListItem from "./comp_listItem/listItem_comp";
const List = (todos) =>{
    return(
        <ul>
            {
                todos.todos.todos.map(todo => <ListItem todoName={todo.value} key={todo.id}/>)
            }
        </ul>
    )
}

export default  List;
